import { range } from 'rxjs';


export default class PathFinder extends React.Component {

    state = {
        nodes: []
    } 

    createMatrix = () => {
        nodes = []
        for(let row=0; row <= 15; row++) {
            const cRow = []
            for(let col=0; col <= 15; col++) {
                cRow.push([])
            }
            nodes.push(row)
        }
        this.setState({nodes})
    }

    componentDidMount() {
        this.createMatrix()
    }

    render() {
        return (
